		["Ulduar - Hodir - Flash Freeze Nameplate Class Icons [Horde]"] = {
			["iconSource"] = -1,
			["wagoID"] = "HvBtcrg63",
			["xOffset"] = 0,
			["preferToUpdate"] = false,
			["yOffset"] = 10,
			["anchorPoint"] = "TOP",
			["cooldownSwipe"] = true,
			["url"] = "https://wago.io/HvBtcrg63/2",
			["icon"] = true,
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_type"] = "stateupdate",
						["debuffType"] = "HELPFUL",
						["event"] = "Health",
						["unit"] = "player",
						["spellIds"] = {
						},
						["events"] = "PLAYER_ENTERING_WORLD, ENCOUNTER_START, ENCOUNTER_END, CLEU:SPELL_AURA_APPLIED, NAME_PLATE_UNIT_ADDED, NAME_PLATE_UNIT_REMOVED, ZONE_CHANGED_INDOORS",
						["custom"] = "function(as,e,...)\n    if e == \"ENCOUNTER_START\" or e == \"ENCOUNTER_END\" then\n        if not aura_env.enabled then return end\n        \n        local eid = ...\n        --print(eid)\n        --print('Resetting Variables (1)')\n        aura_env.reset_vars()\n    elseif e == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        if not aura_env.enabled then return end\n        \n        local _, _, _, _, _, _, _, destGUID, _, _, _, spellID = ...\n        \n        if destGUID and spellID == aura_env.spellid_flashfreeze then\n            \n            -- Reset variables if it's a different Flash Freeze Set\n            local ts = GetTime()\n            if not aura_env.ts_flashfreeze or (ts-aura_env.ts_flashfreeze) > 5 then -- arbitary 5sec threshold\n                --print('Resetting Variables (2)')\n                aura_env.reset_vars(ts)\n            end\n            \n            -- Increment freeze index (we need this because the order in which NPCs are frozen is the same order in which the Flash Freeze spawns)\n            aura_env.freeze_cnt = aura_env.freeze_cnt + 1\n            \n            -- If it's an NPC we're tracking, add the freeze index to the table\n            local npcid = aura_env.get_npcid(destGUID)\n            if npcid then\n                --print(\"GUID: \" .. destGUID or \"\")\n                --print(\"NPC ID: \" .. npcid or \"\")\n                if aura_env.tbl_npcid_highlight[npcid] then\n                    --print('Adding Freeze Idx ' .. aura_env.freeze_cnt .. ' to table')\n                    aura_env.tbl_freeze_spawn_ids[aura_env.freeze_cnt] = npcid\n                end\n            end\n        end\n    elseif e==\"NAME_PLATE_UNIT_ADDED\" then\n        if not aura_env.enabled then return end\n        local unit = ...\n        return aura_env.update_state_table(as,unit)\n    elseif e == \"NAME_PLATE_UNIT_REMOVED\" then\n        if not aura_env.enabled then return end\n        \n        local unit = ...\n        if not unit then return end\n        \n        local unit_guid = UnitGUID(unit)\n        \n        if as[unit_guid] then\n            as[unit_guid].changed = true\n            as[unit_guid].show = false\n            return true\n        end\n    elseif e == \"STATUS\" or e == \"ZONE_CHANGED_INDOORS\" or e == \"PLAYER_ENTERING_WORLD\" then\n        \n        if e == \"PLAYER_ENTERING_WORLD\" then\n            --print('Resetting Variables (3)')\n            aura_env.reset_vars()\n        end\n        \n        if GetSubZoneText() == aura_env.config[\"HodirSubZoneText\"] then\n            --print('Enabling')\n            aura_env.enabled = true\n            \n            -- This only triggers when /wa window closes, so it updates\n            -- the nameplates since NAME_PLATE_UNIT_ADDED events aren't fired\n            local changed_anything\n            local list_nameplates = C_NamePlate.GetNamePlates()\n            for _,v in pairs(list_nameplates) do\n                local unit = v.namePlateUnitToken\n                if aura_env.update_state_table(as,unit) then\n                    changed_anything = true\n                end\n            end\n            return changed_anything\n        else\n            --print('Disabling')\n            aura_env.enabled = false\n            \n            for k,v in pairs(as) do\n                v.changed = true\n                v.show = false\n            end\n            \n            return true\n        end\n    end\nend",
