				},
				["init"] = {
					["custom"] = "-- Flash Freeze NPC ID\n-- 32926: Spawns during the encounter\n-- 32938: Appears pre-pull\naura_env.npcid_flashfreeze_prespawn = 32938 -- https://www.wowhead.com/wotlk/npc=32938/flash-freeze\naura_env.npcid_flashfreeze = 32926 -- https://www.wowhead.com/wotlk/npc=32926/flash-freeze\n\n-- Flash Freeze Spell ID\n-- 61969: Used during the encounter\n-- 61990: Appears pre-pull (don't want to deal with this one)\naura_env.spellid_flashfreeze = 61969 -- https://www.wowhead.com/wotlk/spell=61969/flash-freeze\n\n-- Key: NPC ID\n-- Value: Icon IDs to display (the ones selected here are class icons)\naura_env.tbl_npcid_highlight = {\n    [32941] = {name=\"Tor\",class=\"DRUID\",icon=625999}, -- Tor Greycloud (Druid)\n    [33333] = {name=\"Kar\",class=\"DRUID\",icon=625999}, -- Kar Greycloud (Druid)\n    \n    [33331] = {name=\"Amira\",class=\"MAGE\",icon=626001}, -- Amira Blazeweaver (Mage)\n    [32946] = {name=\"Veesha\",class=\"MAGE\",icon=626001}, -- Veesha Blazeweaver (Mage)\n    \n    [32948] = {name=\"Eliza\",class=\"PRIEST\",icon=626004}, -- Battle-Priest Eliza (Priest)\n    [33330] = {name=\"Gina\",class=\"PRIEST\",icon=626004}, -- Battle-Priest Gina (Priest)\n    \n    [33332] = {name=\"Tara\",class=\"SHAMAN\",icon=626006}, -- Spiritwalker Tara (Shaman)\n    [32950] = {name=\"Yona\",class=\"SHAMAN\",icon=626006}, -- Spiritwalker Yona (Shaman)\n}\n\n-- Remove any NPCs that were not enabled in Custom Options tab\nfor k,_ in pairs(aura_env.tbl_npcid_highlight) do\n    if aura_env.config[\"Display\" .. k] == false then\n        aura_env.tbl_npcid_highlight[k] = nil\n    end\nend\n\n-- Key: Flash Freeze (NPC: 32938, the one that pre-spawns before encounter starts) Spawn Order ID\n-- Value: The NPC ID that's inside the Flash Freeze\n-- These are hard-coded based on the observed pattern of GUIDs\n-- The names might be swapped because of RNG on the spawn timings? But the classes should be correct?\naura_env.tbl_flashfreeze_prespawnid_to_npcid = {\n    [5] = 32941, -- Tor Greycloud (Druid)\n    [3] = 32948, -- Battle-Priest Eliza (Priest)\n    [8] = 33332, -- Spiritwalker Tara (Shaman)\n    [6] = 33331, -- Amira Blazeweaver (Mage)\n    [1] = 33333, -- Kar Greycloud (Druid)\n    [4] = 32950, -- Spiritwalker Yona (Shaman)\n    [7] = 33330, -- Battle-Priest Gina (Priest)\n    [2] = 32946, -- Veesha Blazeweaver (Mage)\n}\n\n\n-- NPCs with the same NPC ID that spawn at the same timestamp are assigned incrementing spawn IDs\n-- In this weakaura, a lot of Flash Freeze NPCs spawn at the same time\n-- The order in which NPCs receive the frozen debuff is the same as the spawn ID\n-- e.g. if Missy Flamecuffs was frozen third, then the corresponding enemy Flash Freeze NPC will have a spawn id of 3\naura_env.get_npc_spawn_id = function(guid)\n    if not guid then return nil end\n    local spawn_uid = select(7,strsplit(\"-\",guid))\n    if not spawn_uid then return nil end\n    local spawn_counter = bit.rshift(bit.band(tonumber(string.sub(spawn_uid, 1, 5), 16), 0xffff8), 3)+1\n    return spawn_counter\nend\n--setglobal(\"gnsi\",aura_env.get_npc_spawn_id)\n\naura_env.get_npcid = function(guid)\n    if not guid then return nil end\n    local npc_id = select(6,strsplit(\"-\",guid))\n    return tonumber(npc_id)\nend\n\naura_env.reset_vars = function(ts)\n    aura_env.ts_flashfreeze = ts\n    aura_env.freeze_cnt = 0\n    aura_env.tbl_freeze_spawn_ids = {}\nend\naura_env.reset_vars()\n\n-- Updates state table to create icons\naura_env.update_state_table = function(as,unit)\n    if not unit then return end\n    \n    local unit_guid = UnitGUID(unit)\n    if not unit_guid then return end\n    \n    local npcid = aura_env.get_npcid(unit_guid) -- flash freeze npc id\n    if npcid ~= aura_env.npcid_flashfreeze and npcid ~= aura_env.npcid_flashfreeze_prespawn then return end\n    \n    \n    local spawn_id = aura_env.get_npc_spawn_id(unit_guid)\n    if not spawn_id then return end\n    \n    --print('Nameplate GUID: ' .. unit_guid)\n    --print('Nameplate Spawn ID: ' .. spawn_id or \"\")\n    \n    local npcid2\n    if npcid == aura_env.npcid_flashfreeze then -- Flash Freeze spawned mid-encounter\n        --print('Spawn ID found in table!')\n        npcid2 = aura_env.tbl_freeze_spawn_ids[spawn_id] -- caster npc id\n        if not npcid2 then return end\n    elseif npcid == aura_env.npcid_flashfreeze_prespawn then -- Flash Freeze spawned before encounter started\n        npcid2 = aura_env.tbl_flashfreeze_prespawnid_to_npcid[spawn_id] -- caster npc id\n        if not npcid2 then return end\n    end\n    \n    local npcinfo = aura_env.tbl_npcid_highlight[npcid2]\n    if not npcinfo then return end\n    \n    as[unit_guid] = {\n        changed=true,\n        show=true,\n        value=1,\n        total=1,\n        name = npcinfo.name,\n        class = npcinfo.class,\n        icon = npcinfo.icon,\n        progressType=\"static\",\n        unit=unit,\n        autoHide = true,\n    }\n    return true\nend",
					["do_custom"] = true,
				},
