						["unit"] = "player",
						["names"] = {
						},
						["custom"] = "function(event, ts, subEvent, _, sourceGUID, sourceName, _, _, destGUID, destName, _, _, spellID, spellName)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        if subEvent then\n            if sourceName == \"Shadow Crash Target\" or spellName == \"Shadow Crash\" then\n                C_Timer.After(0.1, function()\n                        --print('---DELAYED')\n                        \n                        -- Scan for boss unit id\n                        local unit = aura_env.get_unit_by_name(\"Faceless Horror\")\n                        if not unit then return end\n                        \n                        -- Keep track of target changes\n                        local unit_target = unit .. \"target\"\n                        local unit_target_name = UnitName(unit_target)\n                        --print(unit_target_name)\n                        if unit_target_name then\n                            if UnitIsUnit(\"player\",unit_target) then\n                                SendChatMessage(\"{rt7} Shadow Crash On Me {rt7}\",\"SAY\")\n                                --print(format(\"Shadow Crash on %s\",unit_target_name))\n                                WeakAuras.ScanEvents(\"TemsVezaxShadowCrashEvent\")\n                            end\n                            --if WeakAuras.CheckRange(unit_target,10,\"<=\") then -- Weakauras is not as accurate\n                            if CheckInteractDistance(unit_target,3) then -- 10 yds, Shadow Crash is 10yards\n                                --print(\"Shadow Crash NEARBY\")\n                                WeakAuras.ScanEvents(\"TemsVezaxShadowCrashEvent\")\n                            end\n                        end\n                    end\n                )\n            end\n        end\n    elseif event == \"TemzVezaxShadowCrashEvent\" then\n        return true\n    end\nend",
