						["custom"] = "function(allStates, event, ...)\n    \n    if event == \"ENCOUNTER_START\" then\n        allStates[\"\"] = {\n            show = true,\n            changed = true,\n            duration = aura_env.cdPull,\n            expirationTime = GetTime() + aura_env.cdPull,\n            progressType = \"timed\"\n        }\n        C_Timer.After(aura_env.cdPull, function()\n                aura_env.cdRepeat(allStates)\n                if not aura_env.ticker then\n                    aura_env.ticker = C_Timer.NewTicker(aura_env.cdWindow, function() aura_env.cdRepeat(allStates) end)\n                end\n        end)\n        return true\n    end\n    \n    if event == \"CHAT_MSG_RAID_BOSS_EMOTE\" then\n        local message = ...\n        if message then\n            if message:find(\"burrows into the ground!\") then\n                if allStates[\"\"] then\n                    allStates[\"\"].show = false\n                    allStates[\"\"].changed = true\n                end\n                return true\n            elseif message:find(\"emerges from the ground!\") then\n                allStates[\"\"] = {\n                    show = true,\n                    changed = true,\n                    duration = 5,\n                    expirationTime = GetTime() + 5,\n                    progressType = \"timed\",\n                }\n                C_Timer.After(5, function()\n                        aura_env.cdRepeat(allStates)\n                        if not aura_env.ticker then\n                            aura_env.ticker = C_Timer.NewTicker(aura_env.cdWindow, function() aura_env.cdRepeat(allStates) end)\n                        end\n                end)\n                return true\n            end\n        end\n    end\nend",
