						["custom"] = "function(allStates, event, _, subEvent, _, _, _, _, _, destGUID, destName, _, _, spellId, _, _, _, _, _, _, _, _, _, absorbedAmount)\n    -- Options\n    if event == \"OPTIONS\" then\n        allStates[WeakAuras.myGUID] = {\n            show = true,\n            changed = true,\n            unit = \"player\",\n            -- Debuff\n            progressType = \"timed\",\n            expirationTime = GetTime(),\n            duration = 12,\n            autoHide = true,\n            -- Healing\n            stacks = 85000,\n        }\n        return true\n    end\n    \n    -- Healing\n    if subEvent == \"SPELL_HEAL_ABSORBED\" then\n        local state = allStates[destGUID]\n        if not state then\n            return false\n        end\n        state.stacks = state.stacks - absorbedAmount\n        state.show = state.stacks > 0\n        state.changed = true\n        return true\n    end\n    \n    -- SPELL_AURA_{APPLIED,REMOVED}\n    if spellId ~= 66237 then  -- Incinerate Flesh\n        return false\n    end\n    \n    if subEvent == \"SPELL_AURA_APPLIED\" then\n        allStates[destGUID] = {\n            show = true,\n            changed = true,\n            unit = destName,  -- names of raid members are valid units\n            -- Debuff\n            progressType = \"timed\",\n            expirationTime = GetTime() + 12,\n            duration = 12,\n            autoHide = true,\n            -- Healing\n            stacks = 85000,\n        }\n        return true\n    end\n    \n    if subEvent == \"SPELL_AURA_REMOVED\" then\n        local state = allStates[destGUID]\n        if not state then\n            return false\n        end\n        state.show = false\n        state.changed = true\n        return true\n    end\n    \n    \n    \n    return false\nend\n\n\n",
