						["custom"] = "function(allStates, event, ...)\n    local a = {...}\n    \n    if event == \"CHAT_MSG_RAID_BOSS_EMOTE\" then\n        local message = a[1]\n        if message then\n            if message:find(\"emerges from the ground!\") then\n                if allStates[\"\"] then\n                    allStates[\"\"].show = false\n                    allStates[\"\"].changed = true\n                    allStates[\"\"].boots = false\n                    allStates[\"\"].bopped = false\n                end\n                return true\n            end\n        end\n    end\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subEvent = a[2]\n        local spellId = a[12]\n        local destName = a[9]\n        if subEvent == \"SPELL_AURA_APPLIED\" and spellId == 67574 then\n            allStates[\"\"] = {\n                show = true,\n                changed = true,\n                duration = 8,\n                expirationTime = GetTime() + 8,\n                progressType = \"timed\",\n                targetName = destName,\n                boots = false,\n                bopped = false,\n            }\n            return true\n        end\n    end\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local _, subEvent, _, _, _, _, _, _, destName, _, _, spellId = ...\n        if subEvent == \"SPELL_AURA_APPLIED\" then\n            if spellId == 54861 and destName == allStates[\"\"].targetName then\n                allStates[\"\"].duration = 4\n                allStates[\"\"].expirationTime = GetTime() + 4\n                allStates[\"\"].changed = true\n                allStates[\"\"].boots = true\n            elseif spellId == 10278 and destName == allStates[\"\"].targetName then\n                allStates[\"\"].duration = 10\n                allStates[\"\"].expirationTime = GetTime() + 10\n                allStates[\"\"].changed = true\n                allStates[\"\"].boots = false\n                allStates[\"\"].bopped = true\n            end\n        end\n        return true\n    end\nend",
