				},
				["init"] = {
					["custom"] = "local tracked = {}\nfor championIndex, champion in ipairs(aura_env.config.champions) do\n    local championAbilities = {}\n    for abilityIndex, ability in ipairs(champion.abilities) do\n        if ability.enabled then\n            championAbilities[ability.spellId] = {\n                class = champion.class,\n                index = (championIndex * 1000) + abilityIndex,\n            }\n        end\n    end\n    tracked[champion.npcId] = championAbilities\nend\n\n\nlocal function ensureState(allStates, npcId, spellId)\n    local ability = (tracked[npcId] or {})[spellId]\n    if not ability then\n        return nil\n    end\n    local key = strconcat(npcId, spellId)\n    local state = allStates[key] or {\n        show = true,\n        changed = true,\n        icon = GetSpellTexture(spellId),\n        index = ability.index,\n        class = ability.class,\n        progressType = \"timed\",\n        expirationTime = 0,\n        duration = 0,\n    }\n    allStates[key] = state\n    return state\nend\n\n\nlocal function ensureStates(allStates, npcId)\n    local championAbilities = tracked[npcId]\n    if not championAbilities then\n        return false\n    end\n    for spellId, _ in pairs(championAbilities) do\n        ensureState(allStates, npcId, spellId)\n    end\n    return true\nend\n\n\nfunction aura_env.COMBAT_LOG_EVENT_UNFILTERED(allStates, _, _, _, sourceGUID, _, _, _, _, _, _, _, spellId)  -- SPELL_CAST_SUCCESS\n    local npcId = select(6, strsplit(\"-\", sourceGUID or \"\"))\n    local state = ensureState(allStates, npcId, spellId)\n    if not state then\n        return false\n    end\n    local spellCooldownMilliseconds = GetSpellBaseCooldown(spellId)\n    local spellCooldown = spellCooldownMilliseconds / 1000\n    state.changed = true\n    state.expirationTime = GetTime() + spellCooldown\n    state.duration = spellCooldown\n    return true\nend\n\n\nfunction aura_env.NAME_PLATE_UNIT_ADDED(allStates, unit)\n    if not unit then\n        return false\n    end\n    local npcId = select(6, strsplit(\"-\", UnitGUID(unit)))\n    return ensureStates(allStates, npcId)\nend\n\n\nfunction aura_env.STATUS(allStates)\n    for _, nameplate in ipairs(C_NamePlate.GetNamePlates()) do\n        aura_env.NAME_PLATE_UNIT_ADDED(allStates, nameplate.namePlateUnitToken)\n    end\n    return true\nend\n\n\nfunction aura_env.OPTIONS(allStates)\n    for i=1,8 do\n        allStates[i] = {\n            show = true,\n            changed = true,\n            icon = 236303,\n            index = i,\n            class = 10,\n            progressType = \"timed\",\n        }\n    end\n    return true\nend",
